column13:
The present invention relates to a ultra-violet curable pressure sensitive adhesive comprising an acrylic polymer and a cationic photoinitiator, wherein said acrylic polymer comprises: 
(i) an acrylic monomer consisting of an acrylic or methacrylic acid derivative of the formula CH 2 =CH(R 1 )(COOR 2 ), wherein R 1  is H or CH 3  and R 2  is C 1-20  alkyl chain; 
(ii) a monomer, wherein the monomer (a) comprises a pendant reactive functional groups selected from both (1) cycloaliphatic epoxide, oxetane, benzophenone or mixtures thereof, and (2) monosubstituted oxirane, and (b) wherein said monomer contains from 0.001 to 0.015 equivalent per 100g of said acrylic polymer; 
and said acrylic polymer is free of multi-(meth)acrylate.
